import styled from 'styled-components';
import IconButton from '@material-ui/core/IconButton';

export const Wrapper = styled.div`
 margin: 40px;

 .BTN {
    position: fixed;
}
`;

export const StyledButton = styled(IconButton)`
 position: fixed;
 z-index: 100;
 right: 15px;
 top: 81px;


`;
